import {useEffect, useState} from "react";



const Quiz = () => {

    const [quizData, setQuizData] = useState([]);

    useEffect(()=>{
        fetch("http://localhost:9090/quiz")
        .then(r => r.json())
        .then(j => setQuizData(j))
    },[]);

    console.log("quizData: ", quizData);


  return (
   <div>
    QuizTime!!!
    {quizData.length}
   </div>
  );
}

export default Quiz;
